import React,{component} from './react'
import {Details} from './patient_detials'
import {Vitals} from './patient_detials'
export class Link extends Component {
    render() {
        return (
            <div class="container">
                <nav>
<Link to="/">Details</Link>
<Link to="/vitals">Vitals</Link>
                </nav>
                <Route
                    path="/"
                    component={Details}
                    exact 
                />
                <Route
                    path="/vitals"
                    component={Vitals} 
                />
            </div>
        );
    }
}
